import React, { useState } from "react";

function Main() {
  const [data, setData] = useState({});

  React.useEffect(() => {
    fetch("https://kevinkkimutai.github.io/charity/db.json")
      .then((response) => response.json())
      .then((data) => setData(data));
  }, []);
  console.log(data);
  return (
    <div>
      <div className="sidenav pt-5" data-bs-theme="dark">
        {data.place &&
          data.place.map((place) => (
           <div></div>
          ))}
      </div>

      <div className="main bg-dark pt-5" data-bs-theme="dark">
        {data.place &&
          data.place.map((place) => (
            <div key={place.ein} >
              <h2>{place.charityName}</h2>
              <p>Categoy: {place.category}</p>
              <p>ZipCode: {place.zipCode}</p>
              <p>City: {place.city}</p>
              <p>State:{place.state}</p>
              <p>{place.phone}</p>
              <p>{place.email}</p>

            </div>
          ))}
      </div>
    </div>
  );
}

export default Main;
